package practiceJava;

public class pettern2022 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 1; i<6; i++) {
			for(int j = 1; j<6; i++) {
				if(j == 1 && i == 1) {
					System.out.print(" ");
				}else {
					System.out.println("*");
				}
			}
		}
	}

}
